import React from 'react';
import '../styles/home.css';
import { Link } from 'react-router-dom';

class SobreMim extends React.Component{
    render() {;
        return (
            <section className='graduateSection'>
                <Link to='/SobreMim'>
                <img src='' className='gabriela' alt=''/>
            </Link>
            <nav>Navegação</nav>
            <section>
                Favorites Songs
        <audio data-testid="audio-component" src="https://www.youtube.com/embed/xQc1883aUnU"  controls>
            <track kind="captions" />
            O seu navegador não suporta o elemento
            <code>audio</code>
        </audio>
        <audio data-testid="audio-component" src="https://www.youtube.com/embed/xQc1883aUnU"  controls>
            <track kind="captions" />
            O seu navegador não suporta o elemento
            <code>audio</code>
        </audio>
            </section>
            <footer>Footer</footer>
            </section>
        )
    }
}

export default SobreMim;
